app.route('/teams/')  // GET all teams
  .get(function (req, res) {  
    res.status(200);  // 200 OK; 404 Not Found
    res.send(JSON.stringify(teams));    
  });

app.route('/teams/:CODE?')
  .get(function (req, res) {  
    console.log(req.params.CODE);    
    res.status(200);  // 200 OK; 404 Not Found
    for(var i=0;i<teams.length;i++){      
      if(teams[i].CODE==req.params.CODE){
        console.log(`Sending...${JSON.stringify(teams[i])}`);
        res.send(JSON.stringify(teams[i]));
        return;
      }
    }
  });

app.route('/players/')  // GET all teams
  .get(function (req, res) {  
    res.status(200);  // 200 OK; 404 Not Found
    res.send(JSON.stringify(players));    
  });

app.route('/players/:TEAMCODE?')
  .get(function (req, res) {  
    console.log(req.params.TEAMCODE);    
    res.status(200);  // 200 OK; 404 Not Found
    let teamPlayers=[];
    for(var i=0;i<players.length;i++){      
      if(players[i].TEAMCODE==req.params.TEAMCODE){
        console.log(`Sending...${JSON.stringify(players[i])}`);
        teamPlayers.push(players[i]);
      }
    }
    res.send(JSON.stringify(teamPlayers));
    return;
  });

 
